script: |
  super -f text -I q5903.spq | sort > q5903.out

inputs:
  - name: q5903.spq
    data: |
      SELECT - 76 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 * + 17 * + 29 * - + col2 + + 27 * - ( - 13 - 58 ) IS NULL;
  - name: tab2

outputs:
  - name: q5903.out
    data: |
      -76
      -76
      -76
